import { StyleSheet, Text, View } from "react-native";
import React from "react";

const styles = StyleSheet.create({
  back: {
    flex: 1,
    backgroundColor: "#5E9CF7",
    alignItems: "center",
    justifyContent: "center",
  },
  button: {
    backgroundColor: "white",
    width: "50%",
    height: "7%",
    borderRadius: 15,
    alignItems: "center",
    justifyContent: "center",
  },
  text: {
    color: "gray",
    fontFamily: "Arial",
    fontSize: 30,
    textTransform: "uppercase",
  },
  input: {
    backgroundColor: "white",
    width: "50%",
    height: "5%",
    paddingBottom: 5,
  },
});

export { styles };
